import React, { useState, useEffect } from 'react';
import backendApi from '../../api/backendApi';

const Dashboard = () => {
  const [stats, setStats] = useState({
    userStats: {
      total_users: 0,
      superadmin_count: 0,
      admin_count: 0,
      user_count: 0,
      active_users_last_week: 0
    },
    subscriptionStats: {
      total_subscriptions: 0,
      active_subscriptions: 0,
      users_with_subscription: 0
    },
    subscription_plans: [],
    access_code_stats: {
      total_codes: 0,
      used_codes: 0,
      available_codes: 0
    },
    recent_registrations: []
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        setLoading(true);
        backendApi.setupTokenRefresh();
        const response = await backendApi.getDashboardStats();

        if (response && response.data) {
          const responseData = response.data;
          setStats({
            userStats: responseData.user_stats || {
              total_users: 0,
              superadmin_count: 0,
              admin_count: 0,
              user_count: 0,
              active_users_last_week: 0
            },
            subscriptionStats: responseData.subscription_stats || {
              total_subscriptions: 0,
              active_subscriptions: 0,
              users_with_subscription: 0
            },
            subscription_plans: responseData.subscription_plans || [],
            access_code_stats: responseData.access_code_stats || {
              total_codes: 0,
              used_codes: 0,
              available_codes: 0
            },
            recent_registrations: responseData.recent_registrations || []
          });
        } else {
          throw new Error('Invalid response format from API');
        }
      } catch (err) {
        console.error('Error fetching dashboard data:', err);
        setError('Failed to load dashboard data. Please try again later.');
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  const getValue = (obj, path, defaultValue = 0) => {
    if (!obj) return defaultValue;
    const properties = path.split('.');
    return properties.reduce((acc, prop) => {
      return acc && acc[prop] !== undefined ? acc[prop] : defaultValue;
    }, obj);
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center h-full p-8">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-gray-900 mx-auto mb-4"></div>
          <div className="text-xl">Loading dashboard data...</div>
        </div>
      </div>
    );
  }

  return (
    <div className="p-6">
      <h1 className="text-2xl font-bold mb-6">Admin Dashboard</h1>

      {error && (
        <div className="bg-red-50 border border-red-200 text-red-600 px-4 py-3 rounded mb-6">
          {error}
        </div>
      )}

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 mb-8">
        {/* User Stats Card */}
        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center justify-between mb-4">
            <h2 className="text-lg font-medium">Users</h2>
            <span className="p-2 bg-blue-100 text-blue-600 rounded-full">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M10 9a3 3 0 100-6 3 3 0 000 6zm-7 9a7 7 0 1114 0H3z" clipRule="evenodd" />
              </svg>
            </span>
          </div>
          <div className="text-3xl font-bold mb-2">{getValue(stats, 'userStats.total_users')}</div>
          <div className="text-sm text-gray-500">
            {getValue(stats, 'userStats.active_users_last_week')} active in last week
          </div>
        </div>

        {/* Subscription Stats Card */}
        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center justify-between mb-4">
            <h2 className="text-lg font-medium">Subscriptions</h2>
            <span className="p-2 bg-green-100 text-green-600 rounded-full">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M4 4a2 2 0 00-2 2v4a2 2 0 002 2V6h10a2 2 0 00-2-2H4zm2 6a2 2 0 012-2h8a2 2 0 012 2v4a2 2 0 01-2 2H8a2 2 0 01-2-2v-4zm6 4a2 2 0 100-4 2 2 0 000 4z" clipRule="evenodd" />
              </svg>
            </span>
          </div>
          <div className="text-3xl font-bold mb-2">{getValue(stats, 'subscriptionStats.total_subscriptions')}</div>
          <div className="text-sm text-gray-500">
            {getValue(stats, 'subscriptionStats.active_subscriptions')} active
          </div>
        </div>

        {/* Access Codes Card */}
        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center justify-between mb-4">
            <h2 className="text-lg font-medium">Access Codes</h2>
            <span className="p-2 bg-yellow-100 text-yellow-600 rounded-full">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M18 8a6 6 0 01-7.743 5.743L10 14l-1 1-1 1H6v-1l1-1 1-1-1.257-1.257A6 6 0 1118 8zm-6-4a1 1 0 10-2 0 2 2 0 012 0z" clipRule="evenodd" />
              </svg>
            </span>
          </div>
          <div className="text-3xl font-bold mb-2">{getValue(stats, 'access_code_stats.total_codes')}</div>
          <div className="text-sm text-gray-500">
            {getValue(stats, 'access_code_stats.available_codes')} available
          </div>
        </div>

        {/* Recent Registrations Card */}
        <div className="bg-white rounded-lg shadow p-6">
          <div className="flex items-center justify-between mb-4">
            <h2 className="text-lg font-medium">Recent Registrations</h2>
            <span className="p-2 bg-purple-100 text-purple-600 rounded-full">
              <svg xmlns="http://www.w3.org/2000/svg" className="h-5 w-5" viewBox="0 0 20 20" fill="currentColor">
                <path fillRule="evenodd" d="M10 18a8 8 0 100-16 8 8 0 000 16zm1-12a1 1 0 10-2 0v4a1 1 0 00.293.707l2.828 2.829a1 1 0 101.415-1.415L11 9.586V6z" clipRule="evenodd" />
              </svg>
            </span>
          </div>
          <div className="text-3xl font-bold mb-2">
            {Array.isArray(stats.recent_registrations) 
              ? stats.recent_registrations.reduce((sum, reg) => sum + (reg.count || 0), 0)
              : 0
            }
          </div>
          <div className="text-sm text-gray-500">
            Last 30 days
          </div>
        </div>
      </div>

      {/* Subscription Plans Distribution */}
      <div className="bg-white rounded-lg shadow p-6 mb-8">
        <h2 className="text-lg font-medium mb-4">Subscription Plans Distribution</h2>
        {Array.isArray(stats.subscription_plans) && stats.subscription_plans.length > 0 ? (
          <div className="grid grid-cols-1 md:grid-cols-3 gap-4">
            {stats.subscription_plans.map((plan, index) => (
              <div key={plan.plan_name || index} className="bg-gray-50 rounded-lg p-4">
                <div className="flex justify-between items-center mb-2">
                  <span className="font-medium">{plan.plan_name || 'Unnamed Plan'}</span>
                  <span className="text-sm text-gray-500">{plan.count || 0} users</span>
                </div>
                <div className="text-sm text-gray-500">
                  Revenue: ${plan.total_revenue || 0}
                </div>
              </div>
            ))}
          </div>
        ) : (
          <div className="text-center py-8 text-gray-500">
            No active subscription plans found
          </div>
        )}
      </div>

      {/* Recent Registrations Chart */}
      <div className="bg-white rounded-lg shadow p-6">
        <h2 className="text-lg font-medium mb-4">Recent User Registrations</h2>
        <div className="h-64">
          {/* Add a chart component here if needed */}
          <div className="text-center text-gray-500">
            Chart visualization coming soon
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
